// SPDX-License-Identifier: MIT

pragma solidity ^0.7.0;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "interfaces/ENS.sol";

// @author Daniel Chilvers
contract StakeYourName is Ownable {
    address immutable ensRegistry = 0x00000000000C2E074eC69A0dFb2997BA6C7d2e1e;
    ENS ens;

    function nameExpiry(string memory label) public view returns(uint) {
        return ens.expiryTimes(uint256(keccak256(abi.encode(label))));
    }


}
